@deleted-role  Daily update: Excuse our delayed update.
* We had an issue in the averager and averaging of the model weights. Where similar to hivemind, simple averaging with different miners (running different hardware, losses, etc) can setback the training or lead to stagnation in training (as we've seen multiple times in hivemind)
* We're currently testing a more rigorous approach for averaging models. Where the weights used to create a weighted average are parameterized and iterated over with SGD to maximize the averaging test/validation score.

